<?php
defined('BASEPATH') or exit('No direct script access allowed');

class View_report extends MX_Controller
{

	function __construct()
	{
		parent::__construct();
	}

	public function index()
	{
		if ($this->session->userdata('auth_key')) {
			$user_id = $this->session->userdata('user_id');
			if ($this->session->userdata('new_user_id') && $this->session->userdata('new_user_id') != "") {
				$user_id = $this->session->userdata('new_user_id');
			}
			$curr_date = date('Y-m-d');
			$week_start_date = date('Y-m-d',(strtotime ('-7 day' , strtotime ($curr_date))));
			$before_month_date = date('Y-m-d',(strtotime ('-30 day' , strtotime ($curr_date))));

			$this->RateAndReviewDb = $this->load->database('RateAndReview', true);
			$this->RateAndReviewDb->select('rv.website_id, rv.hotel_id, rv.positive_review, rv.negative_review, rv.total_reviews, rv.notes, ww.Name, ht.hotel_name, rv.positive_description, rv.negative_description, ht.image, rv.attachments');
			$this->RateAndReviewDb->from('Responded_Reviews rv');
			$this->RateAndReviewDb->join('ci_websites as ww', 'ww.id = rv.website_id', 'left');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rv.hotel_id', 'left');
			$this->RateAndReviewDb->where('rv.client_id', $user_id);
			$this->RateAndReviewDb->where('respond_date', $curr_date);
			$this->RateAndReviewDb->where('rv.is_deleted', 0);
			$Responded_Reviews = $this->RateAndReviewDb->get();
			$Responded_Reviews = $Responded_Reviews->result_array();
			$hotel_names = array_column($Responded_Reviews, 'hotel_name');
			$hotel_names = array_unique($hotel_names);

			$this->RateAndReviewDb->select('ht.hotel_name, rc.conclusion');
			$this->RateAndReviewDb->from('Review_Conclusion rc');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rc.hotel_id', 'left');
			$this->RateAndReviewDb->where('ht.client_id', $user_id);
			$this->RateAndReviewDb->where('rc.date', $curr_date);
			$conclusions = $this->RateAndReviewDb->get();
			$conclusions = $conclusions->result_array();

			$this->RateAndReviewDb->select('user_name');
			$this->RateAndReviewDb->from('RR_CustomerDetail');
			$this->RateAndReviewDb->where('id', $user_id);
			$this->RateAndReviewDb->where('user_status', 1);
			$username = $this->RateAndReviewDb->get();
			$username = $username->row_array();

			$this->RateAndReviewDb->select('rv.website_id, rv.hotel_id, rv.positive_review, rv.negative_review, rv.total_reviews, rv.notes, ww.Name, ht.hotel_name, rv.positive_description, rv.negative_description, ht.image, rv.attachments');
			$this->RateAndReviewDb->from('Responded_Reviews rv');
			$this->RateAndReviewDb->join('ci_websites as ww', 'ww.id = rv.website_id', 'left');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rv.hotel_id', 'left');
			$this->RateAndReviewDb->where('rv.client_id', $user_id);
			$this->RateAndReviewDb->where("respond_date BETWEEN '$week_start_date' AND '$curr_date'");
			$this->RateAndReviewDb->where('rv.is_deleted', 0);
			$weekly_Responded_Reviews = $this->RateAndReviewDb->get();
			$weekly_Responded_Reviews = $weekly_Responded_Reviews->result_array();

			$weekly_report_title = "Last Week [".date("M j", strtotime($week_start_date))." to ".date("M j", strtotime($curr_date))."]";

			$this->RateAndReviewDb->select('rv.website_id, rv.hotel_id, rv.positive_review, rv.negative_review, rv.total_reviews, rv.notes, ww.Name, ht.hotel_name, rv.positive_description, rv.negative_description, ht.image, rv.attachments');
			$this->RateAndReviewDb->from('Responded_Reviews rv');
			$this->RateAndReviewDb->join('ci_websites as ww', 'ww.id = rv.website_id', 'left');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rv.hotel_id', 'left');
			$this->RateAndReviewDb->where('rv.client_id', $user_id);
			$this->RateAndReviewDb->where("respond_date BETWEEN '$before_month_date' AND '$curr_date'");
			$this->RateAndReviewDb->where('rv.is_deleted', 0);
			$monthly_Responded_Reviews = $this->RateAndReviewDb->get();
			$monthly_Responded_Reviews = $monthly_Responded_Reviews->result_array();

			$monthly_report_title = "Last Month [".date("M j", strtotime($before_month_date))." to ".date("M j", strtotime($curr_date))."]";

			$page = "view_report";
			$this->load->view('v_view_report', compact('username', 'curr_date', 'Responded_Reviews', 'hotel_names', 'conclusions', 'page', 'weekly_Responded_Reviews', 'weekly_report_title', 'monthly_Responded_Reviews', 'monthly_report_title'));
		} else {
			redirect('login');
		}
	}

	public function filter_view_report()
	{
		if ($this->session->userdata('auth_key')) {
			$user_id = $this->input->post('user_id');
			$user_name = $this->input->post('user_name');
			$hotel_id = $this->input->post('hotel_id');
			$this->RateAndReviewDb = $this->load->database('RateAndReview', true);
			if ($user_id == "" || $user_id == "undefined") {
				$user_id = $this->session->userdata('user_id');

				$this->RateAndReviewDb->select('user_name');
				$this->RateAndReviewDb->from('RR_CustomerDetail');
				$this->RateAndReviewDb->where('id', $user_id);
				$this->RateAndReviewDb->where('user_status', 1);
				$username = $this->RateAndReviewDb->get();
				$username = $username->row_array();
				$user_name = $username['user_name'];
			}
			$date = $this->input->post('date');
			$week_start_date = date('Y-m-d',(strtotime ('-7 day' , strtotime ($date))));
			$before_month_date = date('Y-m-d',(strtotime ('-30 day' , strtotime ($date))));

			$this->RateAndReviewDb->select('rv.website_id, rv.hotel_id, rv.positive_review, rv.negative_review, rv.total_reviews, rv.notes, ww.Name, ht.hotel_name, rv.positive_description, rv.negative_description, ht.image, rv.attachments');
			$this->RateAndReviewDb->from('Responded_Reviews rv');
			$this->RateAndReviewDb->join('ci_websites as ww', 'ww.id = rv.website_id', 'left');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rv.hotel_id', 'left');
			$this->RateAndReviewDb->where('rv.client_id', $user_id);
			if ($hotel_id!="" && $hotel_id!="all" && $hotel_id!="undefined"){
				$this->RateAndReviewDb->where('ht.id', $hotel_id);
			}
			$this->RateAndReviewDb->where('respond_date', $date);
			$this->RateAndReviewDb->where('rv.is_deleted', 0);
			$Responded_Reviews = $this->RateAndReviewDb->get();
			$Responded_Reviews = $Responded_Reviews->result_array();
			$hotel_names = array_column($Responded_Reviews, 'hotel_name');
			$hotel_names = array_unique($hotel_names);

			$this->RateAndReviewDb->select('ht.hotel_name, rc.conclusion');
			$this->RateAndReviewDb->from('Review_Conclusion rc');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rc.hotel_id', 'left');
			$this->RateAndReviewDb->where('ht.client_id', $user_id);
			if ($hotel_id!="" && $hotel_id!="all" && $hotel_id!="undefined"){
				$this->RateAndReviewDb->where('ht.id', $hotel_id);
			}
			$this->RateAndReviewDb->where('rc.date', $date);
			$conclusions = $this->RateAndReviewDb->get();
			$conclusions = $conclusions->result_array();

			$this->RateAndReviewDb->select('rv.website_id, rv.hotel_id, rv.positive_review, rv.negative_review, rv.total_reviews, rv.notes, ww.Name, ht.hotel_name, rv.positive_description, rv.negative_description, ht.image, rv.attachments');
			$this->RateAndReviewDb->from('Responded_Reviews rv');
			$this->RateAndReviewDb->join('ci_websites as ww', 'ww.id = rv.website_id', 'left');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rv.hotel_id', 'left');
			$this->RateAndReviewDb->where('rv.client_id', $user_id);
			if ($hotel_id!="" && $hotel_id!="all" && $hotel_id!="undefined"){
				$this->RateAndReviewDb->where('ht.id', $hotel_id);
			}
			$this->RateAndReviewDb->where("respond_date BETWEEN '$week_start_date' AND '$date'");
			$this->RateAndReviewDb->where('rv.is_deleted', 0);
			$weekly_Responded_Reviews = $this->RateAndReviewDb->get();
			$weekly_Responded_Reviews = $weekly_Responded_Reviews->result_array();

			$weekly_report_title = "Last Week [".date("M j", strtotime($week_start_date))." to ".date("M j", strtotime($date))."]";

			$this->RateAndReviewDb->select('rv.website_id, rv.hotel_id, rv.positive_review, rv.negative_review, rv.total_reviews, rv.notes, ww.Name, ht.hotel_name, rv.positive_description, rv.negative_description, ht.image, rv.attachments');
			$this->RateAndReviewDb->from('Responded_Reviews rv');
			$this->RateAndReviewDb->join('ci_websites as ww', 'ww.id = rv.website_id', 'left');
			$this->RateAndReviewDb->join('client_hotels as ht', 'ht.id = rv.hotel_id', 'left');
			$this->RateAndReviewDb->where('rv.client_id', $user_id);
			$this->RateAndReviewDb->where("respond_date BETWEEN '$before_month_date' AND '$date'");
			$this->RateAndReviewDb->where('rv.is_deleted', 0);
			$monthly_Responded_Reviews = $this->RateAndReviewDb->get();
			$monthly_Responded_Reviews = $monthly_Responded_Reviews->result_array();

			$monthly_report_title = "Last Month [".date("M j", strtotime($before_month_date))." to ".date("M j", strtotime($date))."]";

			$view_report_data = $this->view_report_html($hotel_names, $Responded_Reviews, $conclusions, $date, $weekly_Responded_Reviews, $weekly_report_title, $monthly_Responded_Reviews, $monthly_report_title);

			echo json_encode(['status' => 1, 'html' => $view_report_data['html'], 'hotel_wise_data' => $view_report_data['hotel_wise_data']]);
			exit;
		} else {
			echo json_encode(['status' => 0]);
			exit;
		}
	}

